    def parse(self, response):

        for rq in response.selector.xpath("//section[@class='story']"):
            name = rq.xpath("//div[@class='hero']/h1/text()").extract()

            if name != 'RxList Page Not Found':
                yield {
                    
                    'type' : 'type',
                    'name' : name,
                    'howToUse' : rq.xpath("//article[@class='pageContainer']/div/section[1]/div/div/div[2]/p/text()").extract(),
                    'indication' :  rq.xpath("//article[@class='pageContainer']/div/section[2]/div/div/div[2]/p/text()").extract(),
                    'Dosage' :rq.xpath("//article[@class='pageContainer']/div/section[3]/div/div/div[2]/p/text()").extract(),
                    'sideEffects':rq.xpath("//article[@class='pageContainer']/div/section[4]/div/div/div[2]/p/text()").extract(),
                    'warnings':rq.xpath("//article[@class='pageContainer']/div/section[6]/div/div/div[2]/p/text()").extract(),
                    'overdose':rq.xpath("//article[@class='pageContainer']/div/section[7]/div/div/div[2]/p/text()").extract(),
                    
                }

            else :
                yield {}
            
            


